import React from 'react';

const Profile = () => {
  return (
    <div className="profile">
      <h2>Profile</h2>
      <p>
        A driven year 3 Information System student majoring in Business Analytics who is adept in communication and IT. I have a great interest in exploring roles which bridge business and IT. I am also motivated to learn as much as I can in any role I am offered. I am looking for opportunities for an internship where I can improve my IT skills and broaden my experience in different sectors.
      </p>
    </div>
  );
};

export default Profile;
